import React from "react";
import { NavLink } from "react-router-dom";

const Card = ({ title, src, to }) => {
  return (
    <NavLink exact to={to} className="inline-block p-4 w-64">
      <div className="bg-white shadow-lg rounded-lg overflow-hidden transform transition-transform hover:scale-105">
        <img src={src} alt={title} className="w-full h-40 object-cover" />
        <div className="p-4">
          <h2 className="text-lg font-semibold">{title}</h2>
        </div>
      </div>
    </NavLink>
  );
};

export default Card;
